"original": |2-
     The set of destinations described by the overlap represents a portion
     of the less specific route that is feasible, but is not currently in
     use.  If a more specific route is later withdrawn, the set of
     destinations described by the overlap will still be reachable using
     the less specific route.
"fixed": |-
  The set of destinations described by the overlap represents a portion of the less specific route that is feasible, but is not currently in use.  If a more specific route is later withdrawn, the set of destinations described by the overlap will still be reachable using the less specific route.
"ko": |-
  중복으로 설명된 목적지 집합은 실행 가능하지만 현재 사용되지 않는 덜 구체적인 경로의 일부를 나타냅니다. 나중에 더 구체적인 경로가 철회되는 경우 중복으로 설명되는 목적지 집합은 덜 구체적인 경로를 사용하여 계속 도달할 수 있습니다.
